import React from "react";
import { useState } from "react";
import Form from 'react-bootstrap/Form';

export default function SettingsForm(){
    //logic here
    const userID = localStorage.getItem('userId');
    console.log(userID);
    return (
        <div className="form-container">
            <form className="settings-form">
                <Form.Label>*First Name:</Form.Label>
                <Form.Control type="text" placeholder="Name" readOnly/>
                <Form.Label>*Email:</Form.Label>
                <Form.Control type="text" placeholder="Email" readOnly/>
                <Form.Label>Phone:</Form.Label>
                <Form.Control type="text" placeholder="Name" readOnly/>

                <Form.Label>*Last Name:</Form.Label>
                <Form.Control type="text" placeholder="Name" readOnly/>
                <Form.Label>*Password:</Form.Label>
                <Form.Control type="text" placeholder="******" readOnly/>
                <Form.Label>*Role:</Form.Label>
                <Form.Control type="text" placeholder="client" readOnly/>

                <Form.Label>Fitness Level:</Form.Label>
                <Form.Control type="text" placeholder="Beginner" readOnly/>
                <Form.Label>Weekly Exercise:</Form.Label>
                <Form.Control type="text" placeholder="{x} Hours/Week" readOnly/>

                <Form.Label>Diet:</Form.Label>
                <Form.Control type="text" placeholder="Diet" readOnly/>
                <Form.Label>Goal:</Form.Label>
                <Form.Control type="text" placeholder="Goal" readOnly/>
            </form>
        </div>
    );
}
